var title_f27_12_27845="Mitral inflow CW Doppler MR";
var content_f27_12_27845=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F66504%7ECARD%2F76117&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F66504%7ECARD%2F76117&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Continuous wave Doppler of mitral regurgitation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 375px; height: 277px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The transmitral continuous wave Doppler in severe mitral regurgitation shows an E wave dominant, restrictive inflow pattern; there is a high velocity E wave, which in this example is 1.7m/sec. The A wave is small and the E/A ratio is therefore increased.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Continuous wave Doppler in mitral regurgitation",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 381px; height: 259px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The continuous wave Doppler of mitral regurgitation, recorded from the left atrium, shows a jet with a symmetrical shape, suggesting that a significant v-wave in the left atrium is unlikely; however, the jet is dense with a well defined envelope and the early onset of regurgitant flow (arrow), suggesting a moderate degree of regurgitation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
