var title_f27_12_27851="Criteria dependent personality";
var content_f27_12_27851=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F81110&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F81110&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Criteria for dependent personality disorder",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1_single\">",
"       Five or more of the following plus general criteria for personality disorder:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       1. Has difficulty making everyday decisions without an excessive amount of advice and reassurance from others",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2. Needs others to assume responsibility for most major areas of his or her life",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       3. Has difficulty expressing disagreement with others because of fear of loss of support or approval",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       4. Has difficulty initiating projects or doing things on his or her own (because of a lack of self-confidence in judgment or abilities rather than a lack of motivation or energy)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       5. Goes to excessive lengths to obtain nurturance and support from others, to the point of volunteering to do things that are unpleasant",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       6. Feels uncomfortable or helpless when alone because of exaggerated fears of being unable to care for himself or herself",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       7. Urgently seeks another relationship as a source of care and support when a close relationship ends",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       8. Is unrealistically preoccupied with fears of being left to take care of himself or herself",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from American Psychiatric Association. Diagnostic and Statistical Manual of Mental Disorders, 4th ed, Text revision (DSM-IV-TR). American Psychiatric Association, Washington, DC, 2000.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
