"   </div>",
"   <div class=\"lgnd\">",
"    The age distribution in children (lower graph)&nbsp;includes all pathologic presentations of Meckels diverticulum including the more common presentations, such as bleeding or diverticulitis,&nbsp;as well&nbsp;as a variety of other presentations, such as persistent omphalomesenteric ducts that result in chronic umbilical drainage, intussusception, and volvulus around a Meckel&rsquo;s band.",
